INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (9, "ヒューマン", "サレンディア救護院", "B", 108501, 150, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "観劇、おままごと", "クルミ（クリスマス）", 9, 12, "泣き虫で臆病な守ってあげたい女の子", 0, "植田佳奈", 40, 6);
